CREATE DEFINER=`root`@`localhost` PROCEDURE `filter_formula_copy`()
BEGIN
	DECLARE fnsh,IN_SEQ INTEGER DEFAULT 0;
	#IN ACCESS_ID varchar(50), ACCESS_LEVEL varchar(50)
	DECLARE x VARCHAR(255) DEFAULT NOT NULL;
	DECLARE IN_FOT_JAM1,IN_FOT_JAM2 time;
	DECLARE IN_FOT_PERSEN FLOAT;
	
	DEClARE field_cursor CURSOR FOR SELECT FOT_JAM1,FOT_JAM2,FOT_PERSEN,SEQ FROM ot_formula ORDER BY START ASC;
	
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET fnsh = TRUE;
	SET @x='';
	SET @y='';
  	OPEN field_cursor;	 
		GET_PERULANGAN: LOOP
				
				FETCH field_cursor INTO IN_FOT_JAM1,IN_FOT_JAM2,IN_FOT_PERSEN,IN_SEQ;
				IF fnsh THEN 
					LEAVE GET_PERULANGAN;
				END IF;
        SET @tglRule=DATE_ADD('2017-09-04', INTERVAL IN_SEQ DAY);
				SET @waktu1='2017-09-04 08:30:00';
				SET @waktu2='2017-09-05 07:00:00';
				
				#SPLIT TIME TABLE NORMAL
				IF (CONCAT(@tglRule,' ',IN_FOT_JAM1))>= @waktu1 AND (CONCAT(@tglRule,' ',IN_FOT_JAM2))<=@waktu2 THEN
				  IF (CONCAT('2017-09-04',' ',IN_FOT_JAM1))>=(CONCAT('2017-09-04',' ','08:00:00')) AND (CONCAT('2017-09-04',' ',IN_FOT_JAM2))<=(CONCAT('2017-09-04',' ','17:00:00')) THEN
							SET @x=@x+IN_FOT_PERSEN;
					END IF;
				END IF;

				#SPLIT TIME TABLE OT
				IF  (CONCAT(@tglRule,' ',IN_FOT_JAM1))>=(CONCAT('2017-09-04',' ','17:00:00')) AND (CONCAT(@tglRule,' ',IN_FOT_JAM2)<=@waktu2) THEN
							 SET @y=@y+IN_FOT_PERSEN;
				END IF;
		END LOOP;
	CLOSE field_cursor;
				
SELECT @x;
SELECT @y;
SELECT @tglRule;

#SELECT @tglRule;
END
;;
