     	       #SPLIT TIME TABLE NORMAL
	         IF (CONCAT(new.IN_TGL,' ',IN_FOT_JAM1))>= (CONCAT(new.IN_TGL,' ','06:00:00')) AND (CONCAT(new.IN_TGL,' ',IN_FOT_JAM2))<=(CONCAT(new.IN_TGL,' ','17:00:00')) THEN			  
